export const path = {
  //public
  HOME: "/",
  AUCTION: "/auction",
  BLOG: "/blog",
  ABOUT: "/about",
  LOGIN: "/login",
  SIGNUP: "/signup",
  //breeder
  BREEDER: [
    { CREATEREQUEST: "/CreateRequest" },
    { HISTORYREQUEST: "/HistoryRequest" },
    { DETAILREQUEST: "/DetailRequest" },
    { PAYMENTRESPONSE: "/PaymentResponse" },
    { FISHLIST: "/FishList" },
    { DETAILFISH: "/DetailFish" },
  ],
  //manage

  MANAGE: "/Manage",
};
